  \"2016-04-11T19:18:30.232764\",\n\t\"name\": \"2007-2008-florida-division-of-emergency-management-fdem-lidar-project-blocks-1-10-southeast-f\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This Light Detection and Ranging (LiDAR)
  LAS dataset is a topographic survey conducted for the State of Florida Division
  of Emergency Management LiDAR Project. These data were produced for the Florida
  Division of Emergency Management. The LiDAR point cloud was flown at a density sufficient
  to support a maximum final post spacing of 4 feet for unobscured areas. 3001 Inc.
  acquired the data from July 12, 2007 through February 8, 2008. The data was divided
  into 5000' by 5000' cells that serve as the final tiling scheme. The State of Florida
  Division of Emergency Management LiDAR Survey was collected under the guidance of
  a Professional Mapper/Surveyor. The data were collected and are organized into 10
  blocks. To determine which block or blocks are in your area of interest, download
  ch2mhill_block_index_shapefile.zip at: https://coast.noaa.gov/htdata/lidar1_z/geoid12a/data/520/supplemental/ch2mhill_block_index_shapefile.zip
  Each block has a metadata record, a Survey Report, a Vertical Accuracy Report and
  a LiDAR Processing Report which may be accessed at: https://coast.noaa.gov/htdata/lidar1_z/geoid12a/data/520/supplemental/\",\n\t\"license_title\":
